import React from 'react';

function Upload() {
  return (
    <div>
      <h1>感谢您的发布</h1>
      <p>您的物品已经成功发布，感谢您的支持！</p>
      const navigate = useNavigate();
      <button onClick={() => navigate('/Home')}>返回首页</button>
    </div>
  );
}

export default Upload;
